import React from "react";

export default function Banner({ country }) {
  return (
    <div className="container">
      <div className="alert alert-primary" role="alert">
        <span>
          <strong>Welcome!</strong>
          <br></br>Please note that the demo version only includes data from the
          BBC World Service as an example.
        </span>
      </div>
    </div>
  );
}
